#include "kcg_types.h"

 kcg_bool kcg_comp_TS_LIBBSP_IMU_InertialData(   TS_LIBBSP_IMU_InertialData *kcg_c1,   TS_LIBBSP_IMU_InertialData *kcg_c2) {   kcg_bool kcg_equ;   kcg_equ = kcg_true;   kcg_equ = kcg_equ & kcg_comp_TS_LIBBSP_IMU_Vect9(       &kcg_c1->TmgyrData,       &kcg_c2->TmgyrData);   kcg_equ = kcg_equ & (kcg_c1->TicStatus2 == kcg_c2->TicStatus2);   kcg_equ = kcg_equ & (kcg_c1->TicStatus1 == kcg_c2->TicStatus1);   kcg_equ = kcg_equ & (kcg_c1->HrgStatus2 == kcg_c2->HrgStatus2);   kcg_equ = kcg_equ & (kcg_c1->HrgStatus1 == kcg_c2->HrgStatus1);   kcg_equ = kcg_equ & (kcg_c1->AccStatus == kcg_c2->AccStatus);   kcg_equ = kcg_equ & (kcg_c1->Tida_sature == kcg_c2->Tida_sature);   kcg_equ = kcg_equ & kcg_comp_TS_LIBBSP_IMU_Vect3(       &kcg_c1->Cpulse_sature,       &kcg_c2->Cpulse_sature);   kcg_equ = kcg_equ & kcg_comp_TS_LIBBSP_IMU_Vect3(       &kcg_c1->Tacc_sature,       &kcg_c2->Tacc_sature);   kcg_equ = kcg_equ & (kcg_c1->Tida_filtre == kcg_c2->Tida_filtre);   kcg_equ = kcg_equ & kcg_comp_TS_LIBBSP_IMU_Vect3(       &kcg_c1->Tacc_filtre,       &kcg_c2->Tacc_filtre);   kcg_equ = kcg_equ & kcg_comp_TS_LIBBSP_IMU_Vect3(       &kcg_c1->accAng_filtF_fPilot_custUnit,       &kcg_c2->accAng_filtF_fPilot_custUnit);   kcg_equ = kcg_equ & kcg_comp_TS_LIBBSP_IMU_Vect3(       &kcg_c1->accAng_filtE_fPilot_custUnit,       &kcg_c2->accAng_filtE_fPilot_custUnit);   kcg_equ = kcg_equ & kcg_comp_TS_LIBBSP_IMU_Vect3(       &kcg_c1->pqr_filtF_fPilot_custUnit,       &kcg_c2->pqr_filtF_fPilot_custUnit);   kcg_equ = kcg_equ & kcg_comp_TS_LIBBSP_IMU_Vect3(       &kcg_c1->pqr_filtE_fPilot_custUnit,       &kcg_c2->pqr_filtE_fPilot_custUnit);   kcg_equ = kcg_equ & kcg_comp_TS_LIBBSP_IMU_Vect3(       &kcg_c1->fs_filtB_BdL_fPilot_custUnit,       &kcg_c2->fs_filtB_BdL_fPilot_custUnit);   kcg_equ = kcg_equ & kcg_comp_TS_LIBBSP_IMU_Vect3(       &kcg_c1->fs_filtA_BdL_fPilot_custUnit,       &kcg_c2->fs_filtA_BdL_fPilot_custUnit);   kcg_equ = kcg_equ & (kcg_c1->cpt_tache_fNav == kcg_c2->cpt_tache_fNav);   kcg_equ = kcg_equ & (kcg_c1->synth_umi == kcg_c2->synth_umi);   kcg_equ = kcg_equ & kcg_comp_TS_LIBBSP_IMU_Vect3(       &kcg_c1->IndFEP,       &kcg_c2->IndFEP);   kcg_equ = kcg_equ & kcg_comp_TS_LIBBSP_IMU_Vect3(       &kcg_c1->ErrFEP,       &kcg_c2->ErrFEP);   kcg_equ = kcg_equ & kcg_comp_TS_LIBBSP_IMU_Vect3(       &kcg_c1->TheteE,       &kcg_c2->TheteE);   kcg_equ = kcg_equ & kcg_comp_TS_LIBBSP_IMU_Vect3(&kcg_c1->Cp, &kcg_c2->Cp);   kcg_equ = kcg_equ & kcg_comp_TS_LIBBSP_IMU_Vect3(&kcg_c1->dV, &kcg_c2->dV);   kcg_equ = kcg_equ & kcg_comp_TS_LIBBSP_IMU_Vect3(       &kcg_c1->dTheta,       &kcg_c2->dTheta);   return kcg_equ; }
